document.addEventListener("DOMContentLoaded", initMap)

function initMap() {
  const mapParent = document.querySelector('#map')
  mapParent.innerHTML = mapSvg()
  mapParent.appendChild(mapSprite())

  const svg = document.querySelector('#map svg')
  const svg_country = svg.querySelectorAll('g.country')
  svg_country.forEach(country => country.addEventListener('mouseenter', showTooltip))
  svg_country.forEach(country => country.addEventListener('mouseleave', hideTooltip))
  svg_country.forEach(country => country.addEventListener('click', moveToCountry))
  svg.addEventListener('mousemove', setTooltipPosition)
}

function tooltip(country) {
  const tooltip = document.createElement('div')
  const countryName = getCountryName(countries(), country.id)

  if (country.classList.contains('sold')) {
    tooltip.className = 'tooltip country-tooltip sold'
  } else { tooltip.className = 'tooltip country-tooltip' }

  tooltip.id = country.id
  tooltip.innerHTML = `
        <div class="tooltip-row">
          <p class="title">${countryName}</p>
          <div class="union">
            <p></p>
            <svg width="48" height="48" viewBox="0 0 48 48" fill="none" xmlns="http://www.w3.org/2000/svg">
              <path fill-rule="evenodd" clip-rule="evenodd" d="M24 4C7.53 4 4 7.53 4 24C4 40.47 7.53 44 24 44C40.47 44 44 40.47 44 24C44 7.53 40.47 4 24 4ZM19.8371 22.085L24.4979 17.4244L29.1611 22.0874L31.8731 19.3754L24.4979 12L17.1252 19.373L19.8371 22.085ZM12.498 23.9996L15.2101 21.2875L17.922 23.9995L15.21 26.7115L12.498 23.9996ZM19.8371 25.915L24.4979 30.5756L29.1609 25.9127L31.8744 28.6232L31.8731 28.6247L24.4979 36L17.1249 28.6272L17.1211 28.6234L19.8371 25.915ZM31.0741 24.0011L33.7862 21.289L36.4981 24.0009L33.786 26.713L31.0741 24.0011ZM27.2484 23.9985H27.2495L24.4976 21.2465L22.4638 23.2803H22.4637L22.2301 23.514L21.7481 23.9961L21.7443 23.9998L21.7481 24.0038L24.4976 26.7533L27.2495 24.0014L27.2509 23.9998L27.2484 23.9985Z" fill="white"/>
            </svg>
          </div>
        </div>
        <div class="subtitle">+ 50-100% MVGT</div>
  `
  return tooltip
}
function showTooltip() {
  document.querySelector('.root').appendChild(tooltip(this))
}
function hideTooltip() {
  // console.log(this.id)
  document.querySelector('.root .country-tooltip#' + this.id).remove()
}
function setTooltipPosition(e) {
  const positionX = e.clientX;
  const positionY = e.clientY;

  const tooltip = document.querySelector('.root .country-tooltip')
  // console.log(tooltip)
  if (tooltip) {
    tooltip.style.left = `${positionX}px`
    tooltip.style.top = `${positionY}px`
  }
}

function moveToCountry() {
  const root = document.querySelector('.root')
  const header = document.querySelector('header')
  root.classList.add('country-active-' + this.id)
  header.setAttribute('data-country-iso', this.id) // Для возврата на главную при нажатии на лого в header
  continueVideo(this.id);
}

