// Копия скриптов из index.js --------------
function continueVideo(planetName) {
  // Запуск видосов после клика
  let skeletonVideo = document.querySelector('#' + planetName + 'Info .nft-skeleton')
  let HAVE_ENOUGH_DATA = 4
  if (skeletonVideo) {
    if (skeletonVideo.readyState === HAVE_ENOUGH_DATA) {
      if (skeletonVideo.paused) {
        skeletonVideo.play()
      }
    } else {
      skeletonVideo.load()
    }
  }
}
